import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
  return (
    <ul>
      <li>Learn React</li>
      <li>Built Awesome App</li>
    </ul>
  );
};

const AppHeader = () => {
  return <h1>My Todo List</h1>;
};

const Searchpannel = () =>{
  return <input placeholder = 'search' />
};

const App = () => {
  return (
  <div>
    <AppHeader />
    <Searchpannel />
    <TodoList />
  </div>
  );
};



ReactDOM.render(<App />, document.getElementById('root'));
